import React from "react";
import Project from './Project.js';
import {readRemoteFile} from 'react-papaparse';

class Projects extends React.Component {
  constructor(props) {
    super (props);
    this.state = {
      items: []
    };
    this.splitter = this.splitter.bind(this);

      readRemoteFile("http://localhost:3001/projectos.csv", {
            complete: (results) => {
              this.splitter(results['data']);
            },
          });
  }

  splitter = (results) => {
    let projectsSelvIkei = [];
    let dadosLength = results.length;
    let filteredCount = 0;
    for (let i = 1; i < dadosLength; i++) {
      if(results[i][0] == this.props.projectNames){
        projectsSelvIkei[filteredCount] = results[i][1];
        let joined = this.state.items.concat([<Project name={projectsSelvIkei[filteredCount]} />]);
        this.setState({items:joined});
        filteredCount++;
      }
    }
  };

  render() {
      return(
        <div id="projects">

        {this.state.items}

        </div>
      )
  }
}


export default Projects
